import './heroStyle.css'

export default function Hero() {
  return (
    <div className='hero'>
      <h1>Continue Watching for Lina</h1>
      <div className='image-sec'>
        <img alt='img'
        src='https://images.unsplash.com/photo-1473286835901-04adb1afab03?q=80&w=1887&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D'/>
        {/* <img alt='img'
        src='https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.themoviedb.org%2Fmovie%2F894803%2Fimages%2Fposters&psig=AOvVaw1C7otEcWDukz7oDWnZ6S6t&ust=1724606902766000&source=images&cd=vfe&opi=89978449&ved=2ahUKEwj80ea_k46IAxXST2wGHcz6Dc8QjRx6BAgAEBg'/> */}

      </div>
    </div>
  )
}
